import React from "react";

class Home extends React.Component {
  render() {
    return(
      <div>
        <header>
          <nav className="indigo"></nav>
          <div className="container">
            <h2 className="homeHeroHeading indigo darken-4 center">Indian Premier League</h2>
            <h4 className="homeHeroSubHeading indigo darken-4 center">Eight weeks of power-packed cricketing action. </h4>
          </div>
        </header>
        <section className="container">
          <h3 className="indigo-text text-darken-4">About IPL</h3>
        </section>

      </div>
    )
  }
}

export default Home;
